// define a function that takes an array of strings as input and returns a number
function f_gold(bank) {
    // initialize variables
    let last = 0, ans = 0;
    // loop through each string in the array
    for (let b of bank) {
        var t;
        // count the number of occurrences of the character "1" in the string
        if ((t = b.split("1").length - 1) > 0) {
            // update the answer by multiplying the previous count with the current count
            ans += last * t;
            // update the previous count to the current count
            last = t;
        }
    }
    // return the final answer
    return ans;
}
